import React, { Component } from 'react';
import './home.css';
export default class Home extends Component{
render(){
    return(

              <section class="site-main page-index " role="main">
             <div class="container">
            <ul>
                <li class="__photo"  style="background: url('http://farm9.staticflickr.com/8517/8562729616_35b1384aa1.jpg')no-repeat center; background-size: cover; "></li>
                <li class="__photo"  style="background: url('http://farm9.staticflickr.com/8465/8113424031_72048dd887.jpg')no-repeat center; background-size: cover; "></li>
                <li class="__photo"  style="background: ('http://farm9.staticflickr.com/8241/8562523343_9bb49b7b7b.jpg')no-repeat center; background-size: cover;  "></li>
            </ul>

        </div>
</section>

    )}
}
